import { Link } from 'react-router-dom'
import  "pages.css"


class Home extends Component {
    render() {
        return (
          <div className="siderbar">
            <div>
              <li>item1</li>
              <li>item2</li>
              <li>item3</li>
              <li>item4</li>
              <li>item5</li>
            </div>
          </div>
        );

    }

}

export default Home;
